import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img  className="App-logo" alt="logo" />
        <p>
          Olivia Schlepphorst
        </p>

      </header>
    </div>
  );
}

export default App;
